import React, { useState } from 'react';
import axios from 'axios';

const TrashData = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    axios.get('http://localhost:3000/data.json')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return [data, setData];
};

export default TrashData;
